script: |
  super -f text -I q5325.spq | sort > q5325.out

inputs:
  - name: q5325.spq
    data: |
      SELECT DISTINCT - cor0.col0 * - 33 AS col2 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q5325.out
    data: |
      2112
      2640
      99
